import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './app';

const youtube = new Youtube(httpClient);

ReactDOM.render(
  <React.StrictMode>
    <App youtube={youtube} />
  </React.StrictMode>,
  document.getElementById('root')
);
